USE transaccion;

DROP TABLE SerSustitutivasRes;
DROP TABLE SerSustitutivas;
DROP PROCEDURE spServioMicrosoftObten;
DROP PROCEDURE spServioMicrosoftActualiza;

CREATE TABLE SerSustitutivas(nID SERIAL PRIMARY KEY,
sRFC nVarChar(13) NOT NULL,
nEjercicio Int NOT NULL,
sIDPeriodo nVarChar(3) NOT NULL,
dRecepcion DATETIME YEAR TO SECOND NOT NULL,
sIDBanco nVarChar(5) NOT NULL,
sIDConcepto nVarChar(6) NOT NULL,
nRenglones INT,
dModificacion DATETIME YEAR TO SECOND,
nEstatus Int NOT NULL,
sEquipo nVarChar(250),
nIntentos Int);

CREATE INDEX inx_SerSustitutivas_sRFC ON SerSustitutivas(sRFC);

CREATE TABLE SerSustitutivasRes(nId SERIAL PRIMARY KEY,
nIdSusWSM Int NOT NULL,
sPagado nVarChar(2) NOT NULL,
sLineaCaptura nVarChar(20),
sTipoOperacion nVarChar(2) NOT NULL,
sMensaje nVarChar(250) NOT NULL,
sNumOperBanco nVarChar(14),
sFOperacion nVarChar(10),
sHOperacion nVarChar(5),
sNumOpeDecla nVarChar(14),
sPresentacion nVarChar(8),
dModificacion DATETIME YEAR TO SECOND,
nEstatus Int,
dOperacion DATETIME YEAR TO SECOND,
dPresentacion DATETIME YEAR TO SECOND,
FOREIGN KEY (nIdSusWSM) REFERENCES SerSustitutivas(nID)
);

CREATE PROCEDURE "ocpnpg".spServioMicrosoftObten(
   pe_nReglonesReserva Integer,
   pe_sEquipo nVarChar(250),
   pe_nIntentos Integer)
RETURNING Integer AS nId, nVarChar(13) AS RFC, DATETIME YEAR TO SECOND AS FechaRecepcion, Integer AS Ejercicio,
         nVarChar(3) AS Periodo, nVarChar(5) AS Banco, nVarChar(6) AS Concepto, DATETIME YEAR TO SECOND AS fModificacion,
         Integer AS nEstatus, nVarChar(250) AS sEquipo, Integer AS nIntentos
{
--static char drversion[]="@(#) : STORE PROCEDURES : spServioMicrosoftObten.sql"
--*******************************************************************************************************
-- Programa:            spServioMicrosoftObten
-- Modulo:              Sustitutivas Microsoft
-- Descripcion:         Consulta Reserva renglones a procesar servicio Microsoft.
-- Autor del Programa:  Angel Ramirez Mancera
-- Fecha:               28/Julio/2020
-- Modificacion:
-- Nota:
--*******************************************************************************************************
}
   
   DEFINE pa_nId                 Integer;
   DEFINE pa_RFC                 nVarChar(13);
   DEFINE pa_FechaRecepcion      DATETIME YEAR TO SECOND;
   DEFINE pa_Ejercicio           Integer;
   DEFINE pa_Periodo             nVarChar(3);
   DEFINE pa_Banco               nVarChar(5);
   DEFINE pa_Concepto            nVarChar(6);
   DEFINE pa_fModificacion       DATETIME YEAR TO SECOND;
   DEFINE pa_nEstatus            Integer;
   DEFINE pa_sEquipo             nVarChar(250);
   DEFINE pa_nIntentos           Integer;

   --SET DEBUG FILE TO '/tmp/spServioMicrosoftObten.txt';
   --TRACE ON;
   IF (pe_nReglonesReserva > 0) THEN
      UPDATE SerSustitutivas
      SET nEstatus = 1,
         dModificacion = sysdate,
         sEquipo = pe_sEquipo,
         nIntentos = 0
      WHERE nID in(SELECT nID
                   FROM (SELECT FIRST pe_nReglonesReserva nID
                         FROM SerSustitutivas
                         WHERE nEstatus = 0
                         ORDER BY nID DESC) A);
   END IF
   FOREACH
      SELECT nID, sRFC, dRecepcion, CASE WHEN nEjercicio IS NULL THEN 0 ELSE nEjercicio END, sIDPeriodo, sIDBanco, 
             sIDConcepto, dModificacion, CASE WHEN nEstatus IS NULL THEN 0 ELSE nEstatus END, 
             CASE WHEN sEquipo IS NULL THEN '' ELSE sEquipo END, CASE WHEN nIntentos IS NULL THEN 0 ELSE nIntentos END
        INTO pa_nId, pa_RFC, pa_FechaRecepcion, pa_Ejercicio, pa_Periodo, pa_Banco, pa_Concepto, pa_fModificacion,
            pa_nEstatus, pa_sEquipo, pa_nIntentos
      FROM SerSustitutivas
      WHERE sEquipo = pe_sEquipo AND nEstatus IN (1, 3) AND nIntentos < pe_nIntentos
      RETURN pa_nId, pa_RFC, pa_FechaRecepcion, pa_Ejercicio, pa_Periodo, pa_Banco, pa_Concepto, pa_fModificacion,
            pa_nEstatus, pa_sEquipo, pa_nIntentos WITH RESUME;
   END FOREACH;
   --TRACE OFF;
END PROCEDURE;

CREATE PROCEDURE "ocpnpg".spServioMicrosoftActualiza(
   p_nIdSusWSM INT, 
   p_nRenglones INT,
   p_nGEstatus INT,  
   p_sPagado nVarChar(2), 
   p_sLineaCaptura nVarChar(20),
   p_sTipoOperacion nVarChar(2),
   p_sMensaje nVarChar(250),
   p_sNumOperBanco nVarChar(14),
   p_sFOperacion nVarChar(10),
   p_sHOperacion nVarChar(5),
   p_sNumOpeDecla nVarChar(14),
   p_sPresentacion nVarChar(8),
   p_dModificacion DATETIME YEAR TO SECOND,
   p_nEstatus Int, 
   p_dOperacion DATETIME YEAR TO SECOND,
   p_dPresentacion DATETIME YEAR TO SECOND)
{
--static char drversion[]="@(#) : STORE PROCEDURES : spServioMicrosiftActualiza.sql"
--*******************************************************************************************************
-- Programa:            spServioMicrosiftActualiza
-- Modulo:              Sustitutivas Microsoft
-- Descripcion:         Actualiza renglones a procesar servicio Microsoft.
-- Autor del Programa:  Angel Ramirez Mancera
-- Fecha:               28/Julio/2020
-- Modificacion:
-- Nota:
--*******************************************************************************************************
}
   --SET DEBUG FILE TO '/tmp/spServioMicrosiftActualiza.txt';
   --TRACE ON;
   IF (p_nGEstatus = 2) THEN
      UPDATE SerSustitutivas 
         SET dModificacion = p_dModificacion, nEstatus = p_nGEstatus, nRenglones = p_nRenglones
      WHERE nID = p_nIdSusWSM;
   END IF
   IF (p_nGEstatus = -1) THEN
               sFOperacion, sHOperacion, sNumOpeDecla, sPresentacion, dModificacion, nEstatus, dOperacion, 
               dPresentacion)
         VALUES (p_nIdSusWSM, p_sPagado, p_sLineaCaptura, p_sTipoOperacion, p_sMensaje, p_sNumOperBanco, 
               p_sFOperacion, p_sHOperacion, p_sNumOpeDecla, p_sPresentacion, p_dModificacion, p_nEstatus, p_dOperacion, 
               p_dPresentacion);
   END IF
   IF (p_nGEstatus = 3) THEN
       UPDATE SerSustitutivas 
         SET dModificacion = p_dModificacion, nIntentos = nIntentos + 1, nEstatus = p_nGEstatus, nRenglones = p_nRenglones
      WHERE nID = p_nIdSusWSM;
   END IF
   --TRACE OFF;
END PROCEDURE;



















































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































